import React from 'react';
import './Tweet.css';

function Tweet(props) {
	return props.tweets.map((tw) => {
		return (
			<div className="tweet__container">
				<div style={{ fontSize: '2rem' }}>{tw.profile_pic}</div>
				<p>{tw.user}</p>
			</div>
		);
	});
}

export default Tweet;
